import React from 'react';
import './App.css';
import { thisExpression } from '@babel/types';

const dogUrl = "http://localhost:3000/pups"
function App() {
  fetch(dogUrl)
    .then(resp => resp.json())

  return (
    <div className="App">
      <div id="filter-div">
        <button id="good-dog-filter">Filter good dogs: OFF</button>
      </div>
      <div id="dog-bar">

      </div>
      <div id="dog-summary-container">
        <h1>DOGGO:</h1>
        <div id="dog-info">

        </div>
      </div>
    </div>
  );
}

export default App;
